with open("governates.csv", "w", encoding="utf-8", newline="") as csvFile:
    csvWriter = csv.writer(csvFile)
    csvWriter.writerow(
        ["Governate", "Area Name", "ATM Name", "Latitude", "Longitude", "Description"]
    )

    toContinue = False

    # print(governateArray)
    for gov in governateArray:
        govId = gov["id"]
