        # if(toContinue == False):
        #     continue

        print("\n", name, "\n")

        for area in gov["areas"]:
            print(area["name"])
            areaId = area["id"]
            areaName = area["name"]
            session = get_legacy_session().get(apiUrl.format(govId, areaId))
            atms = json.loads(session.text)
            for atm in atms:
                # append in csv file: govName, areaName, atmName, atmLat, atmLng, atmWorkingHours
                atmName = atm["name"]
                atmLat = atm["lat"]
                atmLng = atm["lng"]
                atmWH = atm["WorkingHours"].replace("\n", "")

                csvWriter.writerow(
                    [
                        name,
                        areaName,
                        atmName,
                        atmLat,
                        atmLng,
                        atmWH,
                    ]
                )

